# This file controls the item that is displayed on Gamble shops #
# If you want to use a custom item that will not get overwritten on an update, set the display-name field to "FIXED" #
# If the field is not set to "FIXED", any time the plugin is loaded, it will be overwrriten #

GAMBLE_DISPLAY:
  ==: org.bukkit.inventory.ItemStack
  v: 2567
  type: PLAYER_HEAD
  meta:
    ==: ItemMeta
    meta-type: SKULL
    display-name: Random Item
    internal: 
